import jxl.* def NumOfXLSRows def XLPath = testRunner.testCase.testSuite.project.getPropertyValue("XLPath2") log.info ("Path : " + XLPath) Workbook objWB = Workbook.getWorkbook(new File(XLPath)) Sheet objSheet = objWB.getSheet(0) NumOfXLSRows = objSheet.getRows() log.info ("Number of TZ_Xls rows: " + NumOfXLSRows) version = objSheet.getCell(1,2).getContents() discipline = objSheet.getCell(2,2).getContents() termtype = objSheet.getCell(3,2).getContents() log.info("version_Value: " + version) log.info("discipline: " + discipline) log.info("termtype: " + termtype)
//testRunner.testCase.testSuite.project.setPropertyValue("version", version) //testRunner.testCase.testSuite.project.setPropertyValue("discipline", discipline) //testRunner.testCase.testSuite.project.setPropertyValue("termtype", termtype) testRunner.testCase.setPropertyValue("version", version) testRunner.testCase.setPropertyValue("discipline", discipline) testRunner.testCase.setPropertyValue("termtype", termtype)
objWB.close()

